(1, 40, 'የዚህ ምዕመን መረጃ ብትክክል ስላልገባ እባካችሁ በትክክል አስገቡ።', '2020-03-16 07:23:27', 1),
(2, 40, 'ላክጅስድ፤ልፍክጅፍድልክ', '2020-03-16 07:24:43', 1),
(3, 40, 'ላመስግነው አምላኬን በሰማይ ላለው ለየሱስ ቅኔን ልቀኝለት', '2020-03-16 07:26:17', 1),
(4, 40, 'yenote memezgebya erroru betikikil astekakiyalew', '2020-03-16 07:28:08', 1),
(5, 39, 'ብቻ እየሱስ ቤቴ ካለ ሙሉ ነው ይበቃኛል። መዝሙር አለኝ ዜማ አለኝ፡ አንተ ወዳለህበት ወደ አደባባይህ ጌታ ', '2020-03-16 08:48:45', 1),
(6, 43, 'አጅክስድክፋጅልክጅስ ድፍልስክድጅፍ ስልድክጅ ፍ', '2020-03-16 14:18:27', 1),
(7, 19, 'ሀና ተክሌ የቤተክርስቲያኒቱ ዘማሪ ናት', '2020-04-06 16:34:49', 1),
(0, 9, 'በቲ በጥሩ መንፈሳዊ ሁኔታ ላይ ትገኛለች', '2020-08-29 15:00:01', 1),
(0, 894, 'ልጆችና ባለቤታቸው አማረች አላሮ ኃይላንድ ማ/ም ያመልካሉ', '2020-10-02 06:59:07', 14),
(0, 939, 'የጥሩነሽ አሻ የእህት ልጅ (ጥሩነሽ ጋር የምትኖር)', '2020-10-02 13:35:11', 14),
